import Header from './components/Header';
import ProfileBrowser from './components/ProfileBrowser';
import Footer from './components/Footer';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Header/>
      <SearchCriteria/>
      <ProfileBrowser/>
        <Routes>
            {/* <Route path ="" element ={}/>
            <Route path="" element ={}/>
            <Route path="" element ={}/> */}
        </Routes>
      <Footer/>
      </BrowserRouter>
    </div>
  );
}

export default App;
